import React, { useEffect, useState } from 'react'
import axios from 'axios'

function DataFetching() {
    const [repos, setRepos] = useState([]);

    useEffect(() => {
        axios.get("https://api.github.com/search/repositories?q=created:%3E2019-01-10&sort=stars")
        .then((res) => {
            console.log(res);
        setRepos(res.data.items)

        })

        .catch(err => {
            console.log(err)
        });


    },[]);

    console.log(repos);

    return(
    <div className ="repos-container">
        <div ClassName= "repo-name">{repos.map((repo) => <p key ={repo.id}>{repo.full_name}></p> )}</div>
        <div className = "repo-url">{repos.map((repo) => <p key={repo.id}>{repo.url}</p>)}</div>
        <div className= "repo-description">{repos.map((repo) => <p key={repo.id}>{repo.description}</p>)}</div>
    </div>
    )
}

export default DataFetching
